import React from 'react';
import NavBar from './NavBar';
import { 
  styled,
  Box,
} from "@mui/material";

const HeaderNav = styled(Box)(() => ({
  backgroundColor: '#3415B0',
}));

export default function Header() {
  return (
    <HeaderNav>
      <NavBar />
    </HeaderNav>
  );
}
